import React, { useEffect } from "react";
import { parse } from "qs";

const App = () => {
  useEffect(() => {
    let data = [
      {
        pseudo: "Moussa",
        age: 27,
        admin: true,
        voiture: "Mercedes"
      },
      {
        pseudo: "Dorian",
        age: 77,
        admin: false,
        voiture: "Bmw"
      },
      {
        pseudo: "Kalil",
        age: 37,
        admin: false,
        voiture: "seat"
      },
      {
        pseudo: "Mory",
        age: 17,
        admin: false,
        voiture: "Peugeot"
      }
    ];

    data
      .filter(ok => ok.age > 19)

      .sort((a, b) => b.age - a.age)
      .map(myData => console.log(myData));
  });

  return <></>;
};

export default App;
